INSERT INTO `singers` (`Id`, `name`, `bio`) VALUES
(4, 'Elena Rodriguez', 'Elena Rodriguez, a visionary jazz pianist and composer, has been enchanting audiences with her innovative blend of classical influences and modern jazz since her debut in 2015. Born in Buenos Aires, Argentina, in 1989, Elena\'s musical journey began at the tender age of six when she discovered her passion for the piano. Her early years were marked by rigorous classical training, but it was her exposure to the vibrant world of jazz that truly shaped her musical identity.\r\n\r\nElena\'s style is a captivating fusion of traditional Latin rhythms and contemporary jazz, infused with her classical roots. Her compositions often reflect her deep connection with her cultural heritage, offering a fresh perspective on Latin jazz. This unique blend has not only resonated with jazz enthusiasts but has also brought the genre to a wider audience.\r\n\r\nIn 2018, Elena released her critically acclaimed album \"Rhythms of the Heart,\" which showcased her prowess as both a composer and performer. The album was a commercial success, earning her several awards, including the prestigious Jazz International Composition Award.');

